import "./about.css";

function About(){
    return(
        <div className="About">
            <div className="container">
            <p className="largeText">About Us</p>
             <div className="aboutText">
            Welcome to Krishna Credit & Co Corporation , we are a loan service company. We're dedicated to providing you the best of loans with reasonable interest, with a focus on dependability , customer service , and Integrity .
            We're working hard to turn our company into a credit company. We hope you are satisfied by our service as much as we enjoy offering them to you.
        </div>
        <div className="byText">Sincerely,
        Krishna Finance.</div>
        </div>
        </div>
    )
}

export default About;
